import { useState } from "react";

const PATIENT = "patient";
const ADMIN = "admin";

const Login = (props) => {

   const [loginUser, setLoginUser] = useState(PATIENT);

   return (
      <section class="form-section border-radius-lg dark-blue">
         <h2>Check Your Wait Time</h2>
         <form id="patient-form">
                <label htmlFor="name">Name:</label>
                <input type="text" id="name" name="name" required />
                <label htmlFor="code">3-Letter Code:</label>
                <input type="text" id="code" name="code" required />
                <button type="submit" className="light-blue border-radius-sm">Check Wait Time</button>
         </form>
      </section>
   );
};

export default Login;
